function App() {
  const onClickHandler = () => {
    window.location.href="https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D1%85%D0%BD%D0%B8%D0%BA,_%D0%9F%D0%B0%D1%88%D0%B0#%D0%A3%D1%87%D0%B0%D1%81%D1%82%D0%B8%D0%B5"
  }

  return (
    <div className="flex justify-center items-center h-screen">
     <div>
      <h1 className='text-8xl font-abc'>00:00</h1>

      <button onClick={onClickHandler} className=" bg-spotify-green text-white w-full h-10 rounded-md justify-self-start">
      <div className="flex justify-start h-full">
      <img src={logo} className=" h-10  inline"/>

      <div>

      </div>
      <h1 className='inline text-base p-1.5'>Log in with Spotify</h1>
      </div>
      </button>

      </div>






    </div>
  );
}

export default App;
